import CategoryItem from "./components/category-item/category-item.component";
const App = () =>{

  const categories = [
    {
      id: 1,
      title: 'Why Puppy Culture?',
      title1:'LEARN MORE',
      imageUrl: 'https://shoppuppyculture.com/cdn/shop/files/logo-transparent_R_250px.png?v=1683621939&width=250.png'
    },
    {
      id: 2,
      title: 'Shop Our Products!',
      title1:'SHOP'
    },
    {
      id: 3,
      title: 'What Should I Buy?',
      title1:'LEARN MORE'
    },
    {
      id: 4,
      title: 'Madcap University',
      title1:'LEARN MORE'
    },

  ];
  return (
    <div className='categories-container'>
      {categories.map(({ title,title1 ,i}) => (
        <div className='category-container'>
          <div className='background-image' />
          <div className='category-body-container'>
            <h1>{title}</h1>
            <h2>{title1}</h2>
            <p>Shop Now</p>
          </div>
        </div>
      ))}
    </div>

  );
}

export default App;
